	const block0 = (context) => { return html`<div class="ui5-combobox-root">${ context.hasValueState ? block1(context) : undefined }<input id="ui5-combobox-input" .value="${ifDefined(context.value)}" inner-input placeholder="${ifDefined(context.placeholder)}" ?disabled=${context.disabled} ?readonly=${context.readonly} value-state="${ifDefined(context.valueState)}" @input="${context._input}" @change="${context._inputChange}" @click=${context._click} @keydown="${context._keydown}" @focusin="${context._focusin}" @focusout="${context._focusout}" aria-expanded="${ifDefined(context.open)}" role="combobox" aria-haspopup="listbox" aria-autocomplete="both" aria-describedby="${ifDefined(context.valueStateTextId)}" aria-label="${ifDefined(context.ariaLabelText)}" aria-required="${ifDefined(context.required)}" data-sap-focus-ref />${ context.icon ? block2(context) : undefined }${ !context.readonly ? block3(context) : undefined }</div>`; };
const block1 = (context) => { return html`<span id="${ifDefined(context._id)}-valueStateDesc" class="ui5-hidden-text">${ifDefined(context.valueStateText)}</span>`; };
const block2 = (context) => { return html`<slot name="icon"></slot>`; };
const block3 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} name="slim-arrow-down" slot="icon" tabindex="-1" input-icon ?pressed="${context._iconPressed}" @click="${context._arrowClick}" dir="${ifDefined(context.effectiveDir)}" accessible-name="${ifDefined(context._iconAccessibleNameText)}"></${scopeTag("ui5-icon", tags, suffix)}>`; };


	return block0(context);
};

export default main;
